import React from 'react';
import Navbrand from '../molecules/Navbrand';
import NavMenu from '../molecules/NavMenu';
import NavItem from '../molecules/NavItem';
import NavLink from '../molecules/NavLink';
import IcCart from '../icons/IcCart';
import IcUser from '../icons/IcUser';

function Navbar({ }) {
    return (
        <div className="bg-white border-b" >
            <div className="container flex justify-between h-14 items-center md:px-4">
                <div>

                    <Navbrand>
                        ZCommerce
                    </Navbrand>

                    <NavMenu>
                        <NavItem>
                            <NavLink href="/" className="flex gap-1" >
                                <IcCart className="w-5 h-5" />
                            Cart
                        </NavLink>
                        </NavItem>

                        <NavItem>
                            <NavLink href="/" className="flex gap-1" >
                                <IcUser className="w-5 h-5" />
                            Signin
                        </NavLink>
                        </NavItem>

                    </NavMenu>

                </div>
            </div>
        </div>
    );
}

export default Navbar;
